using System.ComponentModel.DataAnnotations;
using System.ComponentModel.DataAnnotations.Schema;
using System.Linq;
using SCAE.Domain.Interfaces.Shared;

namespace SCAE.Domain.Entities.Financeiro
{
    [Table("tipolistabanco", Schema = "financeiro")]
    public class TipoListaBanco : IEntity
    {
        [Key, Column(Order = 1), DatabaseGenerated(DatabaseGeneratedOption.None)]
        public int Id { get; set; }
        [StringLength(60), Required] public string Nome { get; set; }
        public string NumeroBanco { get; set; }
        public string LogoBanco { get; set; }
        [NotMapped] public static TipoListaBanco Santander => new TipoListaBanco(1, "Banco Santander", "033", "");
        [NotMapped] public static TipoListaBanco Bradesco => new TipoListaBanco(2, "Banco Bradesco", "237", "");
        [NotMapped] public static TipoListaBanco BancoDoBrasil => new TipoListaBanco(3, "Banco do Brasil", "001", "");
        [NotMapped] public static TipoListaBanco Sicoob => new TipoListaBanco(4, "Banco Sicoob", "756", "");
        [NotMapped] public static TipoListaBanco Sicredi => new TipoListaBanco(5, "Banco Sicredi", "748", "");
        [NotMapped] public static TipoListaBanco Safra => new TipoListaBanco(6, "Banco Safra", "422", "");
        [NotMapped] public static TipoListaBanco Inter => new TipoListaBanco(7, "Banco Inter", "077", "");

        public TipoListaBanco(int id, string nome, string numeroBanco, string logoBanco)
        {
            Id = id;
            Nome = nome;
            NumeroBanco = numeroBanco;
            LogoBanco = logoBanco;
        }

        public static TipoListaBanco[] ObterDados()
        {
            return new TipoListaBanco[]
            {
                Santander,
                Bradesco,
                Sicoob,
                Sicredi,
                BancoDoBrasil,
                Safra,
                Inter
            };
        }

        public static TipoListaBanco Obter(int id)
        {
            return ObterDados().FirstOrDefault(x => x.Id == id);
        }

        public static TipoListaBanco ObterPorNome(string tipo)
        {
            if (string.IsNullOrEmpty(tipo))
                return null;

            return ObterDados().SingleOrDefault(x => x.Nome.ToUpper() == tipo.ToUpper());
        }
    }
}